import React, {Component} from 'react';


class Home extends Component {
    constructor() {
        super();
        this.state = { items: [] };
        this.state= {users:[]}
    }

    componentDidMount() {
        fetch('https://api.github.com/users')
        .then(res => res.json())
        .then(data => {
          console.log(data);
          this.setState({
            users:data
          })
        })
        .catch(console.log)
      }

    render() {
        return(
            <div>
                <ul>
                    {
                         this.state.items.map((item) =>{
                            return(
                                 <li></li>
                            )
                        })
                    }
                </ul>
            </div>
        )
    }
}


export default Home
